परियोजनाओं / पेरोल के लिए ट्रैकिंग समय की एक स्वतंत्र और सरल विधि की आवश्यकता है। {{}

टाइम ट्रैकिंग करने के लिए इस मुफ्त एक्सटेंशन का उपयोग करना शुरू करें। {{}

बस प्रोजेक्ट का शीर्षक लिखें और स्टार्ट प्रेस करें
हमारा टाइम ट्रैकर समय शुरू करेगा।
एक बार जब आप प्रोजेक्ट पूरा कर लेते हैं, तो स्टॉप दबाएं और समय ट्रैकिंग इस प्रोजेक्ट के लिए रुक जाएगी
आप जब चाहें प्रोजेक्ट्स को शुरू और रोक सकते हैं।

एक बार जब आप अपना समय ट्रैकिंग समाप्त कर लेते हैं, तो इस डेटा को CSV प्रारूप में निर्यात करना संभव है ताकि आप ग्राहकों / शो के लिए डेटा तैयार कर सकें
प्रत्येक कार्य के लिए लिया गया समय। {२}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस Chrome एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। फ्री टाइम क्लॉक के स्वामित्व में नहीं है, इसके द्वारा लाइसेंस प्राप्त नहीं है और यह Google इंक की सहायक कंपनी नहीं है।
